style.css:
/* Arka planı turuncu yap */
body {
    background-color: #ffaf30 !important;
    color: black !important;
}

/* Eğer diğer elementlerin renklerini de değiştirmek istersen */
p, h1, h2, h3, h4, h5, h6, a {
    color: black !important;
}

/* Linklerin varsayılan halini ve tıklanmış hallerini siyah yap */
a, a:visited {
    color: black !important;
}
